// The various changing selectors at the top of the page
let num_bars = document.getElementById("num_bars");
let centered_bars = document.getElementById("centered_bars");
let add_color = document.getElementById("add_color");
let increase_size = document.getElementById("increase_size");
let button = document.getElementById("button");


const viz_box = document.getElementById("viz_box");
const audio_visualizer = document.getElementById("audio_visualizer");
audio_visualizer.width = window.innerWidth;
audio_visualizer.height = window.innerHeight;

const ctx = audio_visualizer.getContext("2d");

let audioSource;
let analyser;
let multiplied;

window.onload = function () {

  button.addEventListener("click", function() {
    const audioContext = new AudioContext();

    
    const audio_controller = document.getElementById("audio_controller");
    audio_controller.src =
      "data:audio/x-wav;base64,";
    audio_controller.play();
    
    if(!audioSource) {
      audioSource = audioContext.createMediaElementSource(audio_controller);
      analyser = audioContext.createAnalyser();
      audioSource.connect(analyser);
      analyser.connect(audioContext.destination);
    }



    // This number can be 32, 64, 128, 256, ... 32,768 default is 2048
    // console.log(num_bars.value);

    analyser.fftSize = num_bars.value;

    // This number is always half of the fft size, so if analyzer.fftsize = 64 this is 32
    const bufferLength = analyser.frequencyBinCount;
    const dataArray = new Uint8Array(bufferLength);
    let barWidth;
    //     Represents one bar in our audio bar
    if (centered_bars.checked) {
      barWidth = audio_visualizer.width / 2 / bufferLength;
    } else {
      barWidth = audio_visualizer.width / bufferLength;
    }

    if (increase_size.checked) {
      multiplied = 2;
    } else {
      multiplied = 1;
    }

    console.log(multiplied);

    let barHeight;
    let x;

    let red_rand = Math.random()
    let blue_rand = Math.random()
    let green_rand = Math.random()
    
    let red_rand_right = Math.random()
    let blue_rand_right = Math.random()
    let green_rand_right = Math.random()
    

    function animate() {
      x = 0;
      ctx.clearRect(0, 0, audio_visualizer.width, audio_visualizer.height);
      analyser.getByteFrequencyData(dataArray);

      if (centered_bars.checked) {
        for (let i = 0; i < bufferLength; i++) {
          barHeight = dataArray[i] * multiplied;
          if (add_color.checked) {
            let red = red_rand*barHeight
            if (red > 255) { red = 255}
            let blue = blue_rand*barHeight
            if (blue > 255) { red = 255}
            let green = green_rand*barHeight
            if (green > 255) { green = 255}
            console.log("This is red: ", red, "This is green: ", green, "This is blue: ", blue);
            ctx.fillStyle =
              "rgb(" + red + "," + blue + "," + green + ")";
          } else {
            ctx.fillStyle = "white";
          }
          ctx.fillRect(
            audio_visualizer.width / 2 - x,
            audio_visualizer.height - barHeight,
            barWidth,
            barHeight
          );
          x += barWidth;
        }
        
        for (let i = 0; i < bufferLength; i++) {
          barHeight = dataArray[i] * multiplied;
          if (add_color.checked) {
            let red = red_rand_right*barHeight
            if (red > 255) { red = 255}
            let blue = blue_rand_right*barHeight
            if (blue > 255) { red = 255}
            let green = green_rand_right*barHeight
            if (green > 255) { green = 255}
            console.log("This is red: ", red, "This is green: ", green, "This is blue: ", blue);
            ctx.fillStyle =
              "rgb(" + red + "," + blue + "," + green + ")";
          } else {
            ctx.fillStyle = "white";
          }
          ctx.fillRect(
            x,
            audio_visualizer.height - barHeight,
            barWidth,
            barHeight
          );
          x += barWidth;
        }
      } 
      
      else {

        
        for (let i = 0; i < bufferLength; i++) {


          if (add_color.checked) {
            let red = red_rand*barHeight
            if (red > 255) { red = 255}
            let blue = blue_rand*barHeight
            if (blue > 255) { red = 255}
            let green = green_rand*barHeight
            if (green > 255) { green = 255}
            console.log("This is red: ", red, "This is green: ", green, "This is blue: ", blue);
            ctx.fillStyle =
              "rgb(" + red + "," + blue + "," + green + ")";
          } else {
            ctx.fillStyle = "white";
          }
          barHeight = dataArray[i] * multiplied;
          ctx.fillRect(
            x,
            audio_visualizer.height - barHeight,
            barWidth,
            barHeight
          );
          x += barWidth;
        }
      }

      requestAnimationFrame(animate);
    }
    animate();
  });
};
